import React, { useEffect, useState } from "react";
import Navbar from "../components/Navbar";
import Home from "../components/HeroBanner";
import Footer from "../components/Footer";
import Projects from "../components/Projects";
import { HowItWorks } from "../components/HowItWorks";
import config from "../config";
import { Grid } from "@material-ui/core";
const HomeScreen = () => {
  const fetchURL = config.drupal_url + "/Home";
  const getItems = () => fetch(fetchURL).then((res) => res.json());
  const [items, setItems] = useState();

  useEffect(() => {
    getItems().then((data) => setItems(data));
  }, [fetchURL, setItems]);

  return (
    <>
      {items && <Navbar navdata={items} />}
      <Grid container xs={12}>
        <Grid item xs={12}>
          {items && <Home data={items} />}
        </Grid>
        <Grid item xs={12}>
          {items && <HowItWorks data={items} />}
        </Grid>
        <Grid item xs={12}></Grid>
        <Grid item xs={12}>
          {items && <Projects project={items} />}
        </Grid>
        <Grid item xs={12}>
          {items && <Footer Footerdata={items} />}
        </Grid>
      </Grid>
    </>
  );
};

export default HomeScreen;
